@ccbd_gfd Why don’t you say the government should anticipate this?
I think you are one of those people who are supportive for the government. There is nothing wrong being supportive, but bear in mind government like you and me, are not imperfect. 
I hope you spare a thought for those dogs that need a haircut. They are God’s creation, and some owners depends on pet Barbers to cut their dogs hair.  Vets only cut before they do any necessary procedure.

@ccbd_gfd certain patients categories such as those who had dermatological lesions and hair issues need a haircut for hygiene and health promotion and treatment issues.  Same with certain dog breeds.
So I think haircut is essential and can be moderated to counter infections.  The issue is time.
Another issue is people are going out and without masks etc..so probably the Minister should look into that.  And allow certain essential services like haircuts to commence.
